import React from 'react'

class GameList extends React.Component {
    componentDidMount(){
        fetch("https://wild-games.herokuapp.com/api/v1")
            .then(res => res.json())
            .then(res => console.log(res))
    }
    render(){
        return(
            <div>Checkpont 2</div>
        )
    }
}
export default GameList
